# Versão 2 de 26/09/2022 - Instalação do Certificado de Segurança - Script cert.sh - Colaboração: Jonilso - CRTE/NRE de Guarapuava


if [ ! $(/usr/bin/whoami) = 'root' ]; then
   echo "Por favor execute com SuperUsuário root!"
   exit 1
fi

#---------------Remover descanso de tela---------------#
#sudo apt-get -y purge xfce4-power-manager
sudo apt-get -y purge light-locker
sudo rm /etc/xdg/autostart/light-locker.desktop
sudo rm /etc/xdg/autostart/xscreensaver.desktop

#---------------Alterar arquivo para descanso de tela na tela de login---------------#
echo "[SeatDefaults]" > /etc/lightdm/lightdm.conf.d/70-linuxmint.conf
echo "user-session=xfce" >> /etc/lightdm/lightdm.conf.d/70-linuxmint.conf
echo "xserver-command=X -s 0 dpms" >> /etc/lightdm/lightdm.conf.d/70-linuxmint.conf


echo -e "\e[44m\nAtualizações defenidas com Sucesso!!!\e[0m\n "

#---------------Mudar plano de fundo para logo oficial do Núcleo Regional de Educação de Assis Chateaubriand---------------#
mkdir -p /tmp/.TelaNRE 2>> /dev/null
TelaNRE="/tmp/.TelaNRE/TelaNRE.tar.gz"
rm -f "$TelaNRE" >> /dev/null 2>&1
cat > "${TelaNRE}.b64" << EndOfThisFileIsExactHereNowReally
