cat > "/usr/sbin/apagar-guest-ao-iniciar.sh" << EndOfThisFile
#!/bin/bash
#sed -i '/^guest-/d' /etc/passwd
grep '^guest-' /etc/passwd| while read x; do
   guest=\$(echo "\$x" | cut -d':' -f1)
